template <typename T, size_t L> struct Vec : std::array<T, L> {

  constexpr T dot(const Vec &v) const { return std::inner_product(this->begin(), this->end(), v.begin(), T{0}); }

  constexpr Vec &operator+=(const Vec &v) {
    for (size_t i = 0; i < L; ++i) {
      (*this)[i] += v[i];
    }
    return *this;
  }

  constexpr Vec &operator=(const Vec &v) { return static_cast<Vec &>(std::array<T, L>::operator=(v)); }

  operator std::string() const {
    std::string s = "[";
    for (size_t i = 0; i < L; ++i) {
      s += std::to_string((*this)[i]);
      if (i != L - 1) {
        s += ", ";
      }
    }
    s += "]";
    return s;
  }
};

template <typename T, size_t R, size_t C> struct Matrix : Vec<Vec<T, C>, R> {
  constexpr Matrix &operator+=(const Matrix &m) {
    for (size_t i = 0; i < R; ++i) {
      (*this)[i] += m[i];
    }
    return *this;
  }

  constexpr Matrix &operator=(const Matrix &m) { return static_cast<Matrix &>(Vec<Vec<T, C>, R>::operator=(m)); }

  operator std::string() const {
    std::string s = "[";
    for (size_t i = 0; i < R; ++i) {
      s += static_cast<std::string>((*this)[i]);
      if (i != R - 1) {
        s += ", ";
      }
    }
    s += "]";
    return s;
  }

  constexpr Matrix &operator=(const Vec<Vec<T, C>, R> &m) {
    return static_cast<Matrix &>(Vec<Vec<T, C>, R>::operator=(m));
  }

  constexpr Matrix &operator=(const std::array<T, R * C> &m) {
    return static_cast<Matrix &>(Vec<Vec<T, C>, R>::operator=(m));
  }

  using Vec<Vec<T, C>, R>::operator=;

  constexpr Vec<T, R * C> flatten() const {
    Vec<T, R * C> r{};
    for (size_t i = 0; i < R; ++i) {
      for (size_t j = 0; j < C; ++j) {
        r[i * C + j] = (*this)[i][j];
      }
    }
    return r;
  }
};

template <typename T, size_t L> std::ostream &operator<<(std::ostream &os, const Vec<T, L> &v) {
  os << static_cast<std::string>(v);
  return os;
}

template <typename T, size_t R, size_t C> std::ostream &operator<<(std::ostream &os, const Matrix<T, R, C> &m) {
  os << static_cast<std::string>(m);
  return os;
}

template <typename T, size_t Channels, size_t Height, size_t Width>
struct Tensor : std::array<Matrix<T, Height, Width>, Channels> {

  using base = std::array<Matrix<T, Height, Width>, Channels>;
  Tensor &operator+=(const Tensor &t) {
    for (size_t i = 0; i < Channels; ++i) {
      (*this)[i] += t[i];
    }
    return *this;
  }

  Vec<T, Channels * Height * Width> flatten() const;

  auto window();

  using value_t = T;
  static constexpr size_t CHANNELS = Channels;
  static constexpr size_t HEIGHT = Height;
  static constexpr size_t WIDTH = Width;
  static constexpr size_t SIZE = Channels * Height * Width;
  static constexpr size_t SIZE2D = Height * Width;
};

template <size_t Delta_Dep, size_t Delta_Row, size_t Delta_Col, typename T, size_t Channels, size_t Height,
          size_t Width>
struct TensorWindow {
  Tensor<T, Channels, Height, Width> *const data;
  const int Row, Col, Dep; // Global offsets

  TensorWindow(Tensor<T, Channels, Height, Width> &data, int row, int col, int dep)
      : data(&data), Row(row), Col(col), Dep(dep) {}

#ifdef DEBUG
  void check_access(size_t depth, size_t row, size_t column) const {
    auto d = static_cast<int>(depth) + Dep;
    auto r = static_cast<int>(row) + Row;
    auto c = static_cast<int>(column) + Col;
    bool valid = (d >= 0 && d < Channels) && (r >= 0 && r < Height) && (c >= 0 && c < Width);
    if (!valid) {
      std::string errmsg =
          std::format("TensorWindow: Access out of bounds {{d({}) >= 0 && d({}) < Channels({}), r({}) >= 0 && "
                      "r({}) < Height({}), c({}) >= 0 && c({}) < Width({})}} evaluated to false",
                      d, d, Channels, r, r, Height, c, c, Width);

      throw std::out_of_range(errmsg);
    }
  }
#endif

  T &at(size_t depth, size_t row, size_t column) {
#ifdef DEBUG
    check_access(depth, row, column);
#endif
    return (*data)[depth + Dep][row + Row][column + Col];
  }

  const T &at(size_t depth, size_t row, size_t column) const {
#ifdef DEBUG
    check_access(depth, row, column);
#endif
    return (*data)[depth + Dep][row + Row][column + Col];
  }

  Vec<T, Delta_Row * Delta_Col * Delta_Dep> flatten() const {
    Vec<T, Delta_Row * Delta_Col * Delta_Dep> v{}; // Zero-initialized

    static_assert(Delta_Dep <= Channels && Delta_Row <= Height && Delta_Col <= Width,
                  "TensorWindow: Delta_Dep, Delta_Row, and Delta_Col must be less than or equal to Channels, Height, "
                  "and Width respectively");

    // Handle completely out-of-bounds cases
    if (Dep >= static_cast<int>(Channels) || Row >= static_cast<int>(Height) || Col >= static_cast<int>(Width) ||
        Dep + static_cast<int>(Delta_Dep) <= 0 || Row + static_cast<int>(Delta_Row) <= 0 ||
        Col + static_cast<int>(Delta_Col) <= 0) {
      throw std::out_of_range("TensorWindow: Access out of bounds");
    }

    // Calculate valid ranges
    const size_t MAX_DEPTH = std::min(Delta_Dep, Channels - std::max(0, Dep));
    const size_t MAX_ROW = std::min(Delta_Row, Height - std::max(0, Row));
    const size_t MAX_COL = std::min(Delta_Col, Width - std::max(0, Col));
    const size_t D_INIT = std::max(0, -Dep);
    const size_t R_INIT = std::max(0, -Row);
    const size_t C_INIT = std::max(0, -Col);

    const size_t R_I_INCREM = (MAX_ROW < Delta_Row) ? (Delta_Row - MAX_ROW) * Delta_Col : 0;
    const size_t C_I_INCREM = (MAX_COL < Delta_Col) ? (Delta_Col - MAX_COL) : 0;

    size_t i = 0;
    for (size_t d = D_INIT; d < MAX_DEPTH; ++d) {
      for (size_t r = R_INIT; r < MAX_ROW; ++r) {
        // Process valid columns in this row
        for (size_t c = C_INIT; c < MAX_COL; ++c) {
          v[i++] = at(d, r, c);
        }

        // Skip out-of-bounds columns
        i += C_I_INCREM;
      }

      // Skip out-of-bounds rows
      i += R_I_INCREM;
    }

    return v;
  }
};

template <size_t Delta_Dep, size_t Delta_Row, size_t Delta_Col, typename T, size_t Channels, size_t Height,
          size_t Width>
auto make_TensorWindow(Tensor<T, Channels, Height, Width> &data, size_t row, size_t col, size_t dep) {
  return TensorWindow<Delta_Dep, Delta_Row, Delta_Col, T, Channels, Height, Width>(data, row, col, dep);
}

template <typename T, size_t Channels, size_t Height, size_t Width> auto Tensor<T, Channels, Height, Width>::window() {
  return make_TensorWindow<Channels, Height, Width, T, Channels, Height, Width>(*this, 0, 0, 0);
}

template <typename T, size_t Channels, size_t Height, size_t Width>
Vec<T, Channels * Height * Width> Tensor<T, Channels, Height, Width>::flatten() const {
  return const_cast<Tensor *>(this)->window().flatten();
}

template <typename T> constexpr T ceil_div(T numerator, T denominator) {
  return (numerator + denominator - 1) / denominator;
}


struct Sigmoid {
  template <typename T> static T call(const T &x) {
    return 1 / (1 + std::exp(-x));
  }
};

struct Tanh {
  template <typename T> static T call(const T &x) { return std::tanh(x); }
};

struct ReLU {
  template <typename T> static T call(const T &x) { return std::max(T(0), x); }
};

struct Linear {
  template <typename T> static T call(const T &x) { return x; }
};

template <typename T, size_t L> Vec<float, L> softmax(const Vec<T, L> &v) {
  Vec<float, L> result;
  T max_val = *std::max_element(v.begin(), v.end());
  T sum = T(0);
  for (size_t i = 0; i < L; ++i) {
    result[i] = std::exp(v[i] - max_val);
    sum += result[i];
  }
  for (size_t i = 0; i < L; ++i) {
    result[i] /= sum;
  }
  return result;
}

template <typename T, size_t L> struct Neuron {
  Vec<T, L> weights;
  T bias;

  Neuron() : weights{}, bias{0} {}

  Neuron(const Vec<T, L> &w, const T &b) : weights{w}, bias{b} {}

  Neuron(const Neuron &n) = default;
  Neuron(Neuron &&n) = default;
  Neuron &operator=(const Neuron &n) {
    if (this != &n) {
      weights = n.weights;
      bias = n.bias;
    }
    return *this;
  }

  Neuron &operator=(Neuron &&n) {
    if (this != &n) {
      weights = std::move(n.weights);
      bias = std::move(n.bias);
    }
    return *this;
  }

  T activate(const Vec<T, L> &input) { return weights.dot(input) + bias; }
};

template <typename T, size_t Params, size_t Filters> struct BasicLayer {
  std::array<Neuron<T, Params>, Filters> neurons;

  BasicLayer() = default;

  BasicLayer(const std::array<Neuron<T, Params>, Filters> &n) : neurons{n} {}

  BasicLayer(const BasicLayer &l) = default;
  BasicLayer(BasicLayer &&l) = default;
  BasicLayer &operator=(const BasicLayer &l) = default;
  BasicLayer &operator=(BasicLayer &&l) = default;

  template <size_t D = 0, typename TensorWindow = void>
  void feed(Vec<T, Params> &input, TensorWindow w) {
    size_t i = 0;
    for (auto &neuron : neurons) {
      switch (D) {
      case 0:
        w.at(i, 0, 0) = neuron.activate(input);
        break;
      case 1:
        w.at(0, i, 0) = neuron.activate(input);
        break;
      case 2:
        w.at(0, 0, i) = neuron.activate(input);
        break;
      default:
        throw std::out_of_range("Invalid dimension for feed");
      }
      ++i;
    }
  }
};

template <typename T, size_t Filters, size_t InputChannels, size_t InputHeight,
          size_t InputWidth, bool SamePadding = true, size_t KernelHeight = 3,
          size_t KernelWidth = 3, size_t Stride = 1>
struct ConvLayer {
  BasicLayer<T, InputChannels * KernelHeight * KernelWidth, Filters> layer;
  using InputTensor = Tensor<T, InputChannels, InputHeight, InputWidth>;

  static constexpr size_t OutputHeight =
      SamePadding ? ceil_div(InputHeight, Stride)
                  : (InputHeight - KernelHeight) / Stride + 1;
  static constexpr size_t OutputWidth =
      SamePadding ? ceil_div(InputWidth, Stride)
                  : (InputWidth - KernelWidth) / Stride + 1;
  Tensor<T, Filters, OutputHeight, OutputWidth> _output;
  using OutputTensor = decltype(_output);

  void feed(InputTensor &input) {
    for (size_t out_y = 0; out_y < OutputHeight; ++out_y) {
      for (size_t out_x = 0; out_x < OutputWidth; ++out_x) {
        int in_y, in_x;
        if constexpr (SamePadding) {
          // Calculate padding needed
          int total_pad_h =
              std::max(0, static_cast<int>((OutputHeight - 1) * Stride +
                                           KernelHeight - InputHeight));
          int total_pad_w =
              std::max(0, static_cast<int>((OutputWidth - 1) * Stride +
                                           KernelWidth - InputWidth));

          int pad_top = total_pad_h / 2;
          int pad_left = total_pad_w / 2;

          // Apply padding offset to input position
          in_y = static_cast<int>(out_y * Stride) - pad_top;
          in_x = static_cast<int>(out_x * Stride) - pad_left;
        } else {
          in_y = out_y * Stride;
          in_x = out_x * Stride;
        }

        auto receptive_field =
            make_TensorWindow<InputChannels, KernelHeight, KernelWidth>(
                input, in_y, in_x, 0);
        auto vec = receptive_field.flatten();
        auto entry = make_TensorWindow<Filters, 1, 1>(_output, out_y, out_x, 0);
        layer.feed(vec, entry);
      }
    }
  }

  decltype(_output) &output() { return _output; }
  const decltype(_output) &output() const { return _output; }
};

template <typename T, size_t Channels, size_t Height, size_t Width>
struct NormLayer {
  std::array<T, Channels> gamma;
  std::array<T, Channels> beta;
  std::array<T, Channels> mean;
  std::array<T, Channels> var;
  static constexpr T epsilon = 1e-5;

  Tensor<T, Channels, Height, Width> _output;

  NormLayer() {
    for (size_t i = 0; i < Channels; ++i) {
      gamma[i] = T(1);
      beta[i] = T(0);
      mean[i] = T(0);
      var[i] = T(1);
    }
  }

  NormLayer(const std::array<T, Channels> &g, const std::array<T, Channels> &b,
            const std::array<T, Channels> &m, const std::array<T, Channels> &v)
      : gamma(g), beta(b), mean(m), var(v) {}

  void feed(const Tensor<T, Channels, Height, Width> &input) {
    for (size_t c = 0; c < Channels; ++c) {
      for (size_t h = 0; h < Height; ++h) {
        for (size_t w = 0; w < Width; ++w) {
          // Apply normalization formula
          T normalized =
              (input[c][h][w] - mean[c]) / std::sqrt(var[c] + epsilon);
          _output[c][h][w] = gamma[c] * normalized + beta[c];
        }
      }
    }
  }

  decltype(_output) &output() { return _output; }
  const decltype(_output) &output() const { return _output; }
};

// Activation layer to apply activation function
template <typename T, size_t Channels, size_t Height, size_t Width,
          typename Activation = ReLU>
struct ActivationLayer {
  Tensor<T, Channels, Height, Width> _output;

  void feed(const Tensor<T, Channels, Height, Width> &input) {
    for (size_t c = 0; c < Channels; ++c) {
      for (size_t h = 0; h < Height; ++h) {
        for (size_t w = 0; w < Width; ++w) {
          _output[c][h][w] = Activation::call(input[c][h][w]);
        }
      }
    }
  }

  decltype(_output) &output() { return _output; }
  const decltype(_output) &output() const { return _output; }
};

template <typename T, size_t Channels, size_t Height, size_t Width,
          typename Activation = ReLU>
struct FusedNormActivationLayer {
  Tensor<T, Channels, Height, Width> _output;

  std::array<T, Channels> gamma;
  std::array<T, Channels> beta;
  std::array<T, Channels> mean;
  std::array<T, Channels> var;
  static constexpr T epsilon = 1e-5;

  FusedNormActivationLayer() {
    for (size_t i = 0; i < Channels; ++i) {
      gamma[i] = T(1);
      beta[i] = T(0);
      mean[i] = T(0);
      var[i] = T(1);
    }
  }

  void feed(Tensor<T, Channels, Height, Width> &input) {
    for (size_t c = 0; c < Channels; ++c) {
      for (size_t h = 0; h < Height; ++h) {
        for (size_t w = 0; w < Width; ++w) {
          // Apply normalization formula
          T normalized =
              (input[c][h][w] - mean[c]) / std::sqrt(var[c] + epsilon);
          _output[c][h][w] = Activation::call(gamma[c] * normalized + beta[c]);
        }
      }
    }
  }

  decltype(_output) &output() { return _output; }
  const decltype(_output) &output() const { return _output; }
};

template <typename T, size_t Channels, size_t Height, size_t Width,
          bool SamePadding = true, typename Activation = ReLU,
          size_t KernelHeight = 3, size_t KernelWidth = 3, size_t Stride = 1>
struct ResBlock {
  ConvLayer<T, Channels, Channels, Height, Width, SamePadding, KernelHeight,
            KernelWidth, Stride>
      conv1, conv2;
  FusedNormActivationLayer<T, Channels, Height, Width> na1;
  NormLayer<T, Channels, Height, Width> norm2;
  ActivationLayer<T, Channels, Height, Width, Activation> activate2;

  using conv1_t = decltype(conv1);
  using InputTensor = typename conv1_t::InputTensor;
  using OutputTensor = typename conv1_t::OutputTensor;

  void feed(InputTensor &input) {
    conv1.feed(input);
    na1.feed(conv1._output);
    conv2.feed(na1._output);
    norm2.feed(conv2._output);
    conv2._output += input; // Residual connection
    activate2.feed(norm2._output);
  }

  OutputTensor &output() { return activate2.output(); }
  const OutputTensor &output() const { return activate2.output(); }
};

template <typename T, size_t Filters, size_t Height, size_t Width,
          size_t Blocks, typename Activation = ReLU, size_t KernelHeight = 3,
          size_t KernelWidth = 3, size_t Stride = 1>
struct ResNet {
  using BlockType = ResBlock<T, Filters, Height, Width, true, Activation,
                             KernelHeight, KernelWidth, Stride>;
  std::array<BlockType, Blocks> blocks;
  using InputTensor = typename BlockType::InputTensor;
  using OutputTensor = typename decltype(blocks)::value_type::OutputTensor;

  void feed(InputTensor &input) {
    OutputTensor *block_input = &input;
    for (auto &block : blocks) {
      block.feed(*block_input);
      block.output() += *block_input; // Residual connection
      block_input = &block.output();
    }
  }

  OutputTensor &output() { return blocks.back().output(); }
  const OutputTensor &output() const { return blocks.back().output(); }
};

template <typename InType, typename OutType, size_t Filters, size_t Channels,
          size_t Height, size_t Width, typename Activation = ReLU>
struct DenseLayer {
  BasicLayer<OutType, Channels * Height * Width, Filters> layer;
  Tensor<OutType, 1, 1, Filters> _output;

  void feed(const Tensor<InType, Channels, Height, Width> &input) {
    auto vec = input.flatten();
    auto entry = make_TensorWindow<1, 1, Filters>(_output, 0, 0, 0);
    if constexpr (std::is_same_v<InType, OutType>) {
      layer.template feed<2>(vec, entry);
    } else {
      auto vec_cast = Vec<OutType, Channels * Height * Width>(vec);
      layer.template feed<2>(vec_cast, entry);
    }
    auto &output = _output[0][0];
    for (auto &x : output) {
      x = Activation::call(x);
    }
  }

  decltype(_output) &output() { return _output; }
  const decltype(_output) &output() const { return _output; }

  auto &out_vector() { return _output[0][0]; }
  const auto &out_vector() const { return _output[0][0]; }
};

template <typename T, size_t ResFilters, size_t PolicyFilters,
          size_t ValueFilters, size_t Channels, size_t Height, size_t Width,
          size_t Blocks>
struct AZNet {
  using value_t = float;
  using prob_t = Vec<value_t, Height * Width>;
  ConvLayer<T, ValueFilters, Channels, Height, Width> conv1;
  FusedNormActivationLayer<T, ValueFilters, Height, Width> na1;
  ResNet<T, ResFilters, Height, Width, Blocks> resnet;

  // Policy head
  ConvLayer<T, PolicyFilters, ResFilters, Height, Width> pi_conv;
  FusedNormActivationLayer<T, PolicyFilters, Height, Width, ReLU> pi_na;
  DenseLayer<T, value_t, Height * Width, PolicyFilters, Height, Width> pi_final;

  // Value head
  ConvLayer<T, ValueFilters, ResFilters, Height, Width, false, 1, 1, 1> v_conv;
  FusedNormActivationLayer<T, ValueFilters, Height, Width> v_na;
  DenseLayer<T, value_t, 1, ValueFilters, Height, Width> v_final;

  Vec<value_t, Height * Width> pi;
  value_t v;

  using InputTensor = typename decltype(conv1)::InputTensor;

  auto feed(InputTensor &input) {
    conv1.feed(input);
    na1.feed(conv1.output());
    resnet.feed(na1.output());
    auto &resnet_output = resnet.output();

    // Policy head
    pi_conv.feed(resnet_output);
    pi_na.feed(pi_conv.output());
    pi_final.feed(pi_na.output());
    pi = softmax(pi_final.out_vector());

    // Value head
    v_conv.feed(resnet_output);
    v_na.feed(v_conv.output());
    v_final.feed(v_na.output());
    v = Tanh::call(v_final.out_vector()[0]);

    return output();
  }

  std::pair<const prob_t &, const value_t &> output() const { return {pi, v}; }
};


using SCALE_T = float;
using SCALE_PTR = const SCALE_T *;
using ZP_T = uint8_t;
using WEIGHT_T = uint8_t;
using BIAS_T = int32_t;
inline constexpr int WEIGHT_MIN = std::numeric_limits<WEIGHT_T>::min();
inline constexpr int WEIGHT_MAX = std::numeric_limits<WEIGHT_T>::max();

template <typename T> constexpr int32_t const_round_half_away_from_zero(T val) {
  // std::round behavior: rounds halves away from zero.
  // e.g., 2.5f -> 3, -2.5f -> -3
  // 0.0f -> 0
  return (val >= 0.0f) ? static_cast<int32_t>(val + 0.5f) : static_cast<int32_t>(val - 0.5f);
}

template <SCALE_PTR pSCALE, ZP_T ZP> constexpr uint8_t quantize(SCALE_T x) {
  static_assert(pSCALE != nullptr && *pSCALE != 0, "pSCALE must not be null and *pSCALE must not be zero");
  return static_cast<WEIGHT_T>(std::clamp(static_cast<int32_t>(std::round(x / (*pSCALE))) + ZP, WEIGHT_MIN, WEIGHT_MAX));
}

template <SCALE_PTR pSCALE, ZP_T ZP> constexpr SCALE_T dequantize(WEIGHT_T x) {
  static_assert(pSCALE != nullptr, "pSCALE must not be null");
  return (static_cast<SCALE_T>(x) - ZP) * (*pSCALE);
}

template <SCALE_PTR pInputScale, ZP_T InputZP, SCALE_PTR pWeightScale, ZP_T WeightZP, SCALE_PTR pOutputScale, ZP_T OutputZP,
          size_t Filters, size_t InputChannels, size_t InputHeight, size_t InputWidth, size_t KernelHeight = 3,
          size_t KernelWidth = 3>
struct QLinearConv {
  Vec<Tensor<int32_t, InputChannels, KernelHeight, KernelWidth>, Filters> w_minus_wzp;
  const Vec<BIAS_T, Filters> &biases;
  Tensor<WEIGHT_T, Filters, InputHeight, InputWidth> _output;

  constexpr QLinearConv(const Vec<Tensor<WEIGHT_T, InputChannels, KernelHeight, KernelWidth>, Filters> &weights_,
                        const Vec<BIAS_T, Filters> &biases_)
      : biases(biases_) {
    for (int f = 0; f < Filters; ++f) {
      for (int c = 0; c < InputChannels; ++c) {
        for (size_t kh = 0; kh < KernelHeight; ++kh) {
          for (size_t kw = 0; kw < KernelWidth; ++kw) {
            // Pre-subtract weight zero point
            w_minus_wzp[f][c][kh][kw] = static_cast<int32_t>(weights_[f][c][kh][kw]) - static_cast<int32_t>(WeightZP);
          }
        }
      }
    }
  }

  using OutputTensor = decltype(_output);
  using InputTensor = Tensor<WEIGHT_T, InputChannels, InputHeight, InputWidth>;

  void feed(const InputTensor &input) {
    static_assert(pInputScale != nullptr && pWeightScale != nullptr && pOutputScale != nullptr, "Scale pointers must not be null");
    static_assert(*pOutputScale != 0, "OutputScale must not be zero");
    static constexpr double M = ((*pInputScale) * (*pWeightScale)) / (*pOutputScale);

    constexpr int pad_h = KernelHeight / 2;
    constexpr int pad_w = KernelWidth / 2;

    for (int f = 0; f < Filters; ++f) {
      for (int h = 0; h < InputHeight; ++h) {
        for (int w = 0; w < InputWidth; ++w) {
          int32_t acc = biases[f];

          for (int c = 0; c < InputChannels; ++c) {
            for (int kh = 0; kh < KernelHeight; ++kh) {
              for (int kw = 0; kw < KernelWidth; ++kw) {
                int32_t ih = static_cast<int32_t>(h) + static_cast<int32_t>(kh) - pad_h;
                int32_t iw = static_cast<int32_t>(w) + static_cast<int32_t>(kw) - pad_w;

                // padding
                int32_t x_q = InputZP; // Default to zero point if out of bounds
                if (ih >= 0 && ih < InputHeight && iw >= 0 && iw < InputWidth) {
                  x_q = input[c][ih][iw];
                }

                acc += (x_q - InputZP) * w_minus_wzp[f][c][kh][kw];
              }
            }
          }

          // Apply bias and requantization
          auto prod = static_cast<double>(acc) * M;
          _output[f][h][w] = std::clamp(static_cast<int32_t>(std::round(prod)) + OutputZP,
                                        static_cast<int32_t>(std::numeric_limits<WEIGHT_T>::min()),
                                        static_cast<int32_t>(std::numeric_limits<WEIGHT_T>::max()));
        }
      }
    }
  }
  decltype(_output) &output() { return _output; }
  const decltype(_output) &output() const { return _output; }
};

// QElemWise: Element-wise addition and multiplication on quantized tensors, inplace applied to the first operand.
template <SCALE_PTR pa_scale, ZP_T a_zp, SCALE_PTR pb_scale, ZP_T b_zp, SCALE_PTR pc_scale, ZP_T c_zp, size_t C, size_t H,
          size_t W>
struct QElemWise {
  using InputTensor = Tensor<WEIGHT_T, C, H, W>;
  using OutputTensor = Tensor<WEIGHT_T, C, H, W>;

  static void add(InputTensor &a, const InputTensor &b) {
    static_assert(pa_scale != nullptr && pb_scale != nullptr && pc_scale != nullptr, "Scale pointers must not be null");
    static_assert(*pc_scale != 0, "c_scale must not be zero");
    static constexpr SCALE_T Sac = (*pa_scale) / (*pc_scale);
    static constexpr SCALE_T Sbc = (*pb_scale) / (*pc_scale);
    for (int c = 0; c < C; ++c) {
      for (int h = 0; h < H; ++h) {
        for (int w = 0; w < W; ++w) {
          // C = (A_scale * (A - A_zero_point) + B_scale * (B - B_zero_point))/C_scale + C_zero_point
          SCALE_T result = static_cast<SCALE_T>(static_cast<int32_t>(a[c][h][w]) - a_zp) * Sac +
                           static_cast<SCALE_T>(static_cast<int32_t>(b[c][h][w]) - b_zp) * Sbc;
          int32_t out_q = static_cast<int32_t>(std::round(result)) + c_zp;
          a[c][h][w] = static_cast<WEIGHT_T>(std::clamp(out_q, WEIGHT_MIN, WEIGHT_MAX));
        }
      }
    }
  }

  static void mul(InputTensor &a, const InputTensor &b) {
    static_assert(pa_scale != nullptr && pb_scale != nullptr && pc_scale != nullptr, "Scale pointers must not be null");
    static_assert(*pc_scale != 0, "c_scale must not be zero");
    static constexpr SCALE_T M = (*pa_scale) * (*pb_scale) / (*pc_scale);

    for (int c = 0; c < C; ++c) {
      for (int h = 0; h < H; ++h) {
        for (int w = 0; w < W; ++w) {
          int32_t a_q = static_cast<int32_t>(a[c][h][w]) - a_zp;
          int32_t b_q = static_cast<int32_t>(b[c][h][w]) - b_zp;
          int32_t prod = a_q * b_q;
          int32_t out_q = static_cast<int32_t>(std::round(prod * M)) + c_zp;
          a[c][h][w] = static_cast<WEIGHT_T>(std::clamp(out_q, WEIGHT_MIN, WEIGHT_MAX));
        }
      }
    }
  }
};

// BNop: Batch Normalization Operation, doing column wise tensor * scalar multiplication or addition
template <SCALE_PTR pa_scale, ZP_T a_zp, SCALE_PTR pb_scale, ZP_T b_zp, SCALE_PTR pc_scale, ZP_T c_zp, size_t C, size_t H,
          size_t W, bool IsMul = true>
struct BNop {
  Vec<SCALE_T, W> Constants;

  constexpr BNop(const Vec<WEIGHT_T, W> &constants) {
    static_assert(pa_scale != nullptr && pb_scale != nullptr && pc_scale != nullptr, "Scale pointers must not be null");
    static_assert(*pc_scale != 0, "c_scale must not be zero");
    constexpr SCALE_T M = IsMul ? (((*pa_scale) * (*pb_scale)) / (*pc_scale)) : ((*pb_scale) / (*pc_scale));
    for (int i = 0; i < constants.size(); ++i) {
      SCALE_T b_val_minus_zp = static_cast<SCALE_T>(constants[i]) - static_cast<SCALE_T>(b_zp); // Constants[i] is already float-cast of original weight
      Constants[i] = b_val_minus_zp * M;
    }
  }

  using InputTensor = Tensor<WEIGHT_T, C, H, W>;
  void mul(InputTensor &input) {
    for (int w = 0; w < W; ++w) {
      for (int c = 0; c < C; c++) {
        for (int h = 0; h < H; ++h) {
          int32_t a_q = input[c][h][w] - a_zp;
          SCALE_T prod = static_cast<SCALE_T>(a_q) * Constants[w];
          int32_t out_q = static_cast<int32_t>(std::round(prod)) + c_zp;
          input[c][h][w] = static_cast<WEIGHT_T>(std::clamp(out_q, WEIGHT_MIN, WEIGHT_MAX));
        }
      }
    }
  }

  void add(InputTensor &input) {
    static_assert(pa_scale != nullptr && pc_scale != nullptr, "Scale pointers must not be null");
    static_assert(*pc_scale != 0, "c_scale must not be zero");
    static constexpr SCALE_T Sac = (*pa_scale) / (*pc_scale);
    for (int w = 0; w < W; ++w) {
      for (int c = 0; c < C; c++) {
        for (int h = 0; h < H; ++h) {
          int a_q = input[c][h][w] - a_zp;
          SCALE_T result = static_cast<SCALE_T>(a_q) * Sac + Constants[w];
          int32_t out_q = static_cast<int32_t>(std::round(result)) + c_zp;
          input[c][h][w] = static_cast<WEIGHT_T>(std::clamp(out_q, WEIGHT_MIN, WEIGHT_MAX));
        }
      }
    }
  }
};

// MatMul: Column-wise apply matrix multiplication on a weight matrix with a vector flattened from a tensor
template <SCALE_PTR pa_scale, ZP_T a_zp, SCALE_PTR pb_scale, ZP_T b_zp, SCALE_PTR pc_scale, ZP_T c_zp, size_t FlattenLen,
          size_t Filters, bool Requant>
struct QGemm {
  using InputVector = Vec<WEIGHT_T, FlattenLen>;
  using InputMatrix = Matrix<WEIGHT_T, FlattenLen, Filters>;
  using OutputVector = Vec<std::conditional_t<Requant, WEIGHT_T, SCALE_T>, Filters>;
  using WeightsMatrix = Matrix<int32_t, FlattenLen, Filters>;
  using BiasVector = Vec<int32_t, Filters>;

  WeightsMatrix _weights_minus_wzp;
  const BiasVector &_biases;
  OutputVector _output;

  constexpr QGemm(const Matrix<uint8_t, FlattenLen, Filters> &weights, const BiasVector &biases) : _biases(biases) {
    for (int f = 0; f < Filters; ++f) {
      for (int i = 0; i < FlattenLen; ++i) {
        _weights_minus_wzp[i][f] = static_cast<int32_t>(weights[i][f]) - static_cast<int32_t>(b_zp);
      }
    }
  }

  void feed(const InputVector &vec) {
    static_assert(pa_scale != nullptr && pb_scale != nullptr, "a_scale and b_scale pointers must not be null");
    if constexpr (Requant) {
        static_assert(pc_scale != nullptr, "c_scale pointer must not be null for requantization");
    }

    for (int j = 0; j < Filters; ++j) {
      int32_t acc = _biases[j];
      for (int i = 0; i < FlattenLen; ++i) {
        acc += static_cast<int32_t>(vec[i] - a_zp) * _weights_minus_wzp[i][j];
      }
      SCALE_T dequantized_acc_value = static_cast<SCALE_T>(acc) * ((*pa_scale) * (*pb_scale));
      if constexpr (Requant) {
        _output[j] = quantize<pc_scale, c_zp>(dequantized_acc_value);
      } else {
        _output[j] = dequantized_acc_value;
      }
    }
  }

  const OutputVector &output() const { return _output; }
};

